import React, { Component } from "react";
import { Parallax } from "react-parallax";

const image2 =
  "https://images.unsplash.com/photo-1612474341291-42f489fa11d3?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=1650&q=80";

export default class ContactPage extends Component {
  render() {
    return (
      <Parallax bgImage={image2} blur={{ min: -10, max: 10 }} strength={-300}>
        <div className="contact" id="contact">
          <div className="form-container">
            <form>
              <label className='form-label-first'>First Name</label>
              <input className='input-first' type="text" />
              <label className='form-label-last'>Last Name</label>
              <input className='input-last' type="text" />
              <div>
              <label className='form-label-msg'>Message</label>
              <textarea className='msg' />
              </div>

              <button className='send-btn'>Send</button>
            </form>
          </div>
        </div>
      </Parallax>
    );
  }
}

